import React from 'react';
import ReactDOM from 'react-dom';
import { Router, Route, BrowserRouter } from 'react-router-dom';
import App from './App';
import './css/main.css';

const Index = () => {
  return (
    <BrowserRouter>
      <Router>
        <Route path='/' component={App} />
      </Router>
    </BrowserRouter>
  );
};

ReactDOM.render(<Index />, document.querySelector('#root'));
